      template: 'index.html', // \u542F\u7528\u7684\u6A21\u677F\uFF08src/index.ejs\uFF09(\u8BE5demo\u91CC\uFF0Creact\u5165\u53E3\u9700\u8981\u5F00\u542F\u6A21\u677F\uFF0Ces\u5165\u53E3\u4E0D\u9700\u8981)
      // templateParameters: { param: 'test' }, // \u6A21\u677F\u53C2\u6570
